import "./Message.css";

function Message(prop) {
	return (
		<div className="message-container">
			<div
				className={
					prop.author === "You"
						? "message message--you"
						: "message message--delilah"
				}
			>
				<strong className="text">{prop.author}</strong>
				<small className="caption">31m</small>
				<br />

				<div className="text">{prop.text.trim()}</div>
			</div>
		</div>
	);
}
export default Message;
